import React from 'react';

function Test02({ Click }) {

    const handlingClick = (e) => {
        const value = e.target.value;
        Click(value);
    }

    return (
        <>
            <button value='USD' onClick={handlingClick}>usd</button>
            <button value='JPY' onClick={handlingClick}>jpy</button>
            <button value='NZD' onClick={handlingClick}>nzd</button>
        </>
    );
}

export default Test02;
